    <div>
        <h1 className='time'>22:05:30</h1>
      <button onClick={()=>{
      newTime= setTime(new Date().getTime());
      }}></button>
       { head=document.querySelector('.time')};
       {head.innerText=newTime}
    </div>
   

  )
}
